import React from 'react';
import { Modal, Button, Space, Typography, Row, Col } from 'antd';

const { Title, Text } = Typography;

const WarningModal = ({ label = '', type = 'info', title = 'title', history }) => {
  function info() {
    Modal.info({
      title: <Title level={3}>{title}</Title>,
      content: (
        <>
          <Row justify='center'>
            <Col span={12} offset={3}>
              <Button type='primary' onClick={() => history.push('/login')}>
                Soy nuevo
              </Button>
            </Col>
          </Row>
          <Row justify='center'>
            <Col span={12}>
              <Button type='link'>Ya tengo cuenta</Button>
            </Col>
          </Row>
        </>
      ),

      onOk() {},
    });
  }

  function success() {
    Modal.success({
      content: 'some messages...some messages...',
    });
  }

  function error() {
    Modal.error({
      title: 'This is an error message',
      content: 'some messages...some messages...',
    });
  }

  function warning() {
    Modal.warning({
      title: 'This is a warning message',
      content: 'some messages...some messages...',
    });
  }

  const [state, setState] = React.useState({
    modal1Visible: false,
    modal2Visible: false,
  });

  const setModal1Visible = (modal1Visible) => {
    setState({ modal1Visible });
  };

  const setModal2Visible = (modal2Visible) => {
    setState({ modal2Visible });
  };
  return (
    <div>
      <Space>
        {type === 'info' && (
          <Button type='primary' onClick={info}>
            {' '}
            {label ? label : 'Info'}
          </Button>
        )}
        {type === 'success' && (
          <Button type='primary' onClick={success}>
            {' '}
            {label ? label : 'Success'}
          </Button>
        )}

        {type === 'error' && (
          <Button type='primary' onClick={error}>
            {' '}
            {label ? label : 'Error'}
          </Button>
        )}

        {type === 'warning' && (
          <Button type='primary' onClick={warning}>
            {' '}
            {label ? label : 'Warning'}
          </Button>
        )}
      </Space>
      <Button type='primary' onClick={() => setModal2Visible(true)}>
        {label ? label : 'default'}{' '}
      </Button>
      <Modal
        title='Vertically centered modal dialog'
        centered
        visible={state.modal2Visible}
        onOk={() => setModal2Visible(false)}
        onCancel={() => setModal2Visible(false)}>
        <p>some contents...</p>
        <p>some contents...</p>
        <p>some contents...</p>
      </Modal>
    </div>
  );
};

export default WarningModal;
